CREATE TABLE
    gitbook
    (
        SEQ bigint(6) unsigned NOT NULL AUTO_INCREMENT,
        book_name VARCHAR(2048),
        book_path VARCHAR(500),
        book_info VARCHAR(500),
        SORT_INFO CHAR(2),
        create_date VARCHAR(18),
        PRIMARY KEY (SEQ)
    )
    ENGINE=InnoDB DEFAULT CHARSET=utf8;

